import React from 'react';
import '../../Assets/style/style.css';
const About = () => {
    return (
        <section
            id="about"
            style={{ backgroundColor: 'black', color: 'white' }}
        >
            <div class="container flex">
                <div class="header" data-animation="slide-in-left">
                    ABOUT
                </div>

                <div class="header-bar" data-animation="slide-in-left"></div>
                <p> I create fast responsive Intuitive Dynamic website</p>
            </div>
        </section>
    );
};

export default About;
